import { Component } from '@angular/core';
import { AuthService } from '../service/auth.service';
import { HttpErrorResponse } from '@angular/common/http';  // Importa HttpErrorResponse para el tipo de error
import { NavController } from '@ionic/angular';

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {
  constructor(
    private authService: AuthService,
    private navCtrl: NavController  // Añade NavController aquí
  ) {}

  login(username: string, password: string): void {
    this.authService.login(username, password).subscribe(
      (response: any) => {
        // Manejar la respuesta del servidor (por ejemplo, almacenar el token de sesión)
        console.log('Login exitoso', response);
        // Redirigir a la página principal o realizar alguna acción adicional
      },
      (error: HttpErrorResponse) => {
        // Manejar el error de autenticación
        console.error('Error de autenticación', error);
      }
    );
  }

  irARegistro(): void {
    this.navCtrl.navigateForward('/registro');  // Ajusta la ruta según tu configuración
  }

  irARecuperarContraseña(): void {
    this.navCtrl.navigateForward('/recuperar-contrasena');  // Ajusta la ruta según tu configuración
  }
}
